import Link from 'next/link';

const SideNav = () => {


  return (
    <div className="side-nav">
      <Link href='/shop'>
        <a  >SHOP</a>
      </Link>
      <Link href='/collections'>
        <a  >COLLECTIONS</a>
      </Link>
      <Link href='/shopInsta'>
        <a  >SHOP INSTA</a>
      </Link>
      <Link href='/blog'>
        <a  >BLOG</a>
      </Link>
      <Link href='/contact'>
        <a  >CONTACT US</a>
      </Link>
      <Link href='/'>
        <a  >HOME</a>
      </Link>
    </div>
  );
};

export default SideNav;
